import React from 'react';
import { BrowserRouter as Router, Routes, Route, Link } from 'react-router-dom';

import SearchPage from './SearchPage';
import ResultPage from './ResultPage';
import JobDetailPage from './JobDetailPage';
import TrendingPage from './TrendingPage';

// Navbar dengan logo gambar
function Navbar() {
  return (
    <nav style={{
      padding: '5px 10px',          // Padding atas bawah 5px, kiri kanan 10px, lebih kecil dari sebelumnya
      backgroundColor: '#2196f3',  
      display: 'flex',
      alignItems: 'center',
      gap: '20px',
      boxShadow: '0 2px 5px rgba(33, 150, 243, 0.3)'// Shadow biru
    }}>
      <Link 
        to="/" 
        style={{ 
          display: 'flex',
          alignItems: 'center',
          textDecoration: 'none',
        }}
      >
        <img 
          src="/logo.png"              // Pastikan logo.png ada di folder public
          alt="Logo KARSO" 
          style={{ height: '80px' }}  // Sesuaikan ukuran logo
        />
      </Link>

      <Link 
        to="/trending"
        className="btn-custom"
        style={{
          marginLeft: 'auto',
          padding: '8px 25px',
          borderRadius: '30px',
          backgroundColor: '#1976d2',
          color: 'white',
          fontWeight: '600',
          textDecoration: 'none',
          transition: 'background-color 0.3s ease',
        }}
        onMouseEnter={e => e.target.style.backgroundColor = '#1565c0'}
        onMouseLeave={e => e.target.style.backgroundColor = '#1976d2'}
      >
        Tren Pencarian
      </Link>
    </nav>
  );
}

export default function App() {
  return (
    <Router>
      <Navbar />
      <Routes>
        <Route path="/" element={<SearchPage />} />
        <Route path="/results" element={<ResultPage />} />
        <Route path="/job-detail" element={<JobDetailPage />} />
        <Route path="/trending" element={<TrendingPage />} />
      </Routes>
    </Router>
  );
}
